import React from "react";

function GenresInDb() {
  useEffect(() => {

    const allInfo = async () => {
      let resProducts = await fetch(`http://localhost:5001/api/products/`);
      let productsSaved = await resProducts.json();
      console.log(productsSaved);


      // title.push("Total de productos");
      // setTitle(title);
      // color.push("warning");
      // setColor(color);
      //   return products;

      let resUsers = await fetch(`http://localhost:5001/api/users/`);
      let usersSaved = await resUsers.json();
      

      setProducts({
        title: "Total de productos",
        quantity: productsSaved.meta.count,
        color: "warning",
        icon: "fa-clipboard-list"
      });
      setUsers({
        title: "Total de usuarios",
        quantity: usersSaved.meta.count,
        color: "primary",
        icon: "fa-users"
      });
      setCategories({
        title: "Total de categorías",
        quantity: productsSaved.meta.categoriesCount,
        color: "danger",
        icon: "fa-asterisk"
      });
    };

    allInfo();
  }, []);

  return (
    <div className="col-lg-6 mb-4">
      <div className="card shadow mb-4">
        <div className="card-header py-3">
          <h5 className="m-0 font-weight-bold text-gray-800">
                     Categorias
          </h5>
        </div>
        <div className="card-body">
          <div className="row">
            <div className="col-lg-6 mb-4">
              <div className="card bg-dark text-white shadow">
                <div className="card-body">Biela</div>
              </div>
            </div>
            <div className="col-lg-6 mb-4">
              <div className="card bg-dark text-white shadow">
                <div className="card-body">Enfriadores</div>
              </div>
            </div>
            <div className="col-lg-6 mb-4">
              <div className="card bg-dark text-white shadow">
                <div className="card-body">Bomba de Aceite</div>
              </div>
            </div>
            <div className="col-lg-6 mb-4">
              <div className="card bg-dark text-white shadow">
                <div className="card-body">Arbol de Leva</div>
              </div>
            </div>
            <div className="col-lg-6 mb-4">
              <div className="card bg-dark text-white shadow">
                <div className="card-body">Tapas de Cilindro</div>
              </div>
            </div>
              </div>
            </div>
          </div>
        </div>
  );
}

export default GenresInDb;
